window.bookSummaryJSON = "<p><i>Spicy enemies to lovers fantasy romance with an HEA.</i></p> <p><b>NEVER CATCH THE COURT JESTER'S ATTENTION. AND NEVER BE ALONE WITH HIM.</b></p> <p>Those were the rules. And I'd broken them.</p> <p>The jester had been a dark temptation. Forbidden. Magnetic. Seductive. His wicked tongue was impossible to resist. Captive to my enemy's heated embrace, I became his obsession. And this devious, sensuous trickster became my destiny.</p> <p>Now our fates are linked. In a kingdom where passion and power clash, I'm the ruined princess he'd walk through fire to protect.</p> <p>But deadly threats are closing in. A dangerous game has begun against the Crown. And if I don't make a cruel deal, my heart will be forced to choose. My claim to the throne. Or my desire for the jester.</p> <p>Contains mature themes.</p>"; 
